(3, 559, 'Africa Cup of Nations', 'files/20210413071346160.png', 'football', 'The Africa Cup of Nations is a biennial international men\'s football championship of Africa organized by the Confederation of African Football.', NULL, 'AdetonaSolomon', 'africa-cup-of-nation', '13-04-2021'),
(4, NULL, 'Africa Cup of Nations Qualification', 'files/20210413074840631.png', 'football', 'The Africa Cup of Nations is a biennial international men\'s football championship of Africa organized by the Confederation of African Football. This is a qualification to the championship.', NULL, 'AdetonaSolomon', 'africa-cup-of-nation', '13-04-2021'),
(5, 9489, 'UEFA Nations League', 'files/20210413075200261.png', 'football', 'The UEFA Nations League is a biennial international football competition contested by the senior men\'s national teams of the member associations of UEFA, the sport\'s European governing body. The first tournament began in September 2018, following the 2018 FIFA World Cup.', NULL, 'AdetonaSolomon', 'uefa-nations-league', '13-04-2021'),
(6, 607, 'Copa America', 'files/20210413075613596.png', 'football', 'CONMEBOL Copa América, known until 1975 as the South American Football Championship, is the main men\'s football tournament contested among national teams from CONMEBOL. It is the oldest international football competition, and is the third most watched competition', NULL, 'AdetonaSolomon', 'copa-america', '13-04-2021'),
(7, 569, 'Asian Cup Football', 'files/20210413080335616.png', 'football', 'The AFC Asian Cup is the primary association football competition contested by the senior men\'s national teams of the members of the Asian Football Confederation, determining the continental champion of Asia. It is the second oldest continental football championship in the world after Copa América.', NULL, 'AdetonaSolomon', 'asian-cup-football', '13-04-2021'),
(8, NULL, 'Olympics Football', 'files/20210413082331575.png', 'football', 'The Summer Olympic Games also known as the Games of the Olympiad, are a major international multi-sport event normally held once every four years. The Games were first held in 1896 in Athens, Greece, and were most recently held in 2016 in Rio de Janeiro, Brazil.', NULL, 'AdetonaSolomon', 'olympics-football', '13-04-2021'),
(9, 8634, 'FIFA World Cup', 'files/20210413083611112.png', 'football', 'The FIFA World Cup, often simply called the World Cup, is an international association football competition contested by the senior men\'s national teams of the members of the Fédération Internationale de Football Association, the sport\'s global governing body.', NULL, 'AdetonaSolomon', 'fifa-world-cup', '13-04-2021'),
(10, NULL, 'FIFA World Cup Qualification', 'files/20210413083737594.png', 'football', 'The FIFA World Cup, often simply called the World Cup, is an international association football competition contested by the senior men\'s national teams of the members of the Fédération Internationale de Football Association, the sport\'s global governing body.', NULL, 'AdetonaSolomon', 'fifa-world-cup-quali', '13-04-2021'),
(11, 618, 'FIFA Confederations Cup', 'files/20210413084345686.png', 'football', 'The FIFA Confederations Cup was an international association football tournament for men\'s national teams, held every four years by FIFA.', NULL, 'AdetonaSolomon', 'fifa-confederations-', '13-04-2021'),
(12, 620, 'International Friendly', 'files/20210413084727336.png', 'football', 'FIFA International Friendlies', NULL, 'AdetonaSolomon', 'international-friend', '13-04-2021'),
(13, 148, 'English Premier League', 'files/20210416011936918.png', 'football', 'The Premier League, often referred to outside the UK as the English Premier League, or sometimes the EPL, is the top level of the English football league system. Contested by 20 clubs, it operates on a system of promotion and relegation with the English Football League.', NULL, 'AdetonaSolomon', 'english-premier-leag', '16-04-2021'),
(14, 8401, 'English Football League', 'files/20210416012047999.png', 'football', 'The English Football League is a league competition featuring professional association football clubs from England and Wales. Founded in 1888 as the Football League, the league is the oldest such competition in world football.', NULL, 'AdetonaSolomon', 'english-football-lea', '16-04-2021'),
(15, 8640, 'EFL Cup', 'files/efl-cup.png\r\n', 'football', 'The EFL Cup, currently known as the Carabao Cup for sponsorship reasons, is an annual knockout football competition in men\'s domestic English football.', NULL, 'AdetonaSolomon', 'efl-cup', '16-04-2021'),
(16, 589, 'UEFA Champions League', 'files/champions-leagues.png', 'football', 'The UEFA Champions League is an annual club football competition organised by the Union of European Football Associations and contested by top-division European clubs, deciding the competition winners through a group and knockout format.', NULL, 'AdetonaSolomon', 'uefa-champions-leagu', '16-04-2021'),
(17, 590, 'UEFA Europa League', 'files/europa-league.png\r\n', 'football', 'The UEFA Europa League is an annual football club competition organised by UEFA since 1971 for eligible European football clubs. Clubs qualify for the competition based on their performance in their national leagues and cup competitions.', NULL, 'AdetonaSolomon', 'uefa-europa-league', '16-04-2021'),
(18, 619, 'FIFA Club World Cup', 'files/club-world-cup.png\r\n', 'football', 'The FIFA Club World Cup is an international men\'s association football competition organised by the Fédération Internationale de Football Association, the sport\'s global governing body. The competition was first contested in 2000 as the FIFA Club World Championship.', NULL, 'AdetonaSolomon', 'fifa-club-world-cup', '16-04-2021'),
(19, 149, 'EFL Championship', 'files/efl-championship.png\r\n', 'football', 'The English Football League Championship is the highest division of the English Football League and second-highest overall in the English football league system after the Premier League. The league is contested by 24 clubs', NULL, 'AdetonaSolomon', 'efl-championship', '16-04-2021'),
(20, 150, 'EFL League One', 'files/efl-league-one.png\r\n', 'football', 'The English Football League One is the second-highest division of the English Football League and the third tier overall in the entire English football league system. League One was introduced for the 2004–05 season.', NULL, 'AdetonaSolomon', 'efl-league-one', '16-04-2021'),
(21, 151, 'EFL League Two', 'files/efl-league-two.png\r\n', 'football', 'The English Football League Two is the third and lowest division of the English Football League and fourth-highest division overall in the English football league system. Football League Two was introduced for the 2004–05 season. It was previously known as the Football League Third Division.', NULL, 'AdetonaSolomon', 'efl-league-two', '16-04-2021'),
(22, 621, 'Club Friendly', 'files/621_club-friendly.png', 'football', 'FIFA Club Friendlies', NULL, 'AdetonaSolomon', 'club-friendly', '13-04-2021'),
(23, 195, 'Bundesliga', 'files/bundesliga.png\r\n', 'football', 'The Bundesliga, sometimes referred to as the Fußball-Bundesliga or 1. Bundesliga, is a professional association football league in Germany. At the top of the German football league system, the Bundesliga is Germany\'s primary football competition.', NULL, 'AdetonaSolomon', 'bundesliga', '16-04-2021'),
(24, 468, 'LaLiga', 'files/laliga.png\r\n', 'football', 'The Campeonato Nacional de Liga de Primera División, commonly known simply as La Liga and officially as LaLiga Santander for sponsorship reasons, stylized as LaLiga, is the men\'s top professional football division of the Spanish football league system.', NULL, 'AdetonaSolomon', 'laliga', '16-04-2021'),
(25, 176, 'France Ligue 1', 'files/france-ligue-1.png\r\n', 'football', 'Ligue 1, officially known as Ligue 1 Uber Eats for sponsorship reasons, is a French professional league for men\'s association football clubs. At the top of the French football league system, it is the country\'s primary football competition.', NULL, 'AdetonaSolomon', 'france-ligue-1', '16-04-2021'),
(26, 177, 'France Ligue 2', 'files/france-ligue-2.png\r\n', 'football', 'Ligue 2, also known as Ligue 2 BKT due to sponsorship by Balkrishna Industries, is a French professional football league. The league serves as the second division of French football and is one of two divisions making up the Ligue de Football Professionnel, the other being Ligue 1, the country\'s top football division.', NULL, 'AdetonaSolomon', 'france-ligue-2', '16-04-2021'),
(27, 262, 'Serie A', 'files/serie-a.png\r\n', 'football', 'Serie A, also called Serie A TIM due to sponsorship by TIM, is a professional league competition for football clubs located at the top of the Italian football league system and the winner is awarded the Scudetto and the Coppa Campioni d\'Italia.', NULL, 'AdetonaSolomon', 'serie-a', '16-04-2021'),
(29, 8760, 'Copa del Rey', 'files/copa-del-rey.png\r\n', 'football', 'The Campeonato de España–Copa de Su Majestad el Rey, commonly known as Copa del Rey or simply La Copa and formerly known as Copa del Generalísimo, is an annual knockout football competition in Spanish football, organized by the Royal Spanish Football Federation.', NULL, 'AdetonaSolomon', 'copa-del-rey', '16-04-2021'),
(30, 537, 'MLS', 'files/mls.png\r\n', 'football', 'Major League Soccer is a men\'s professional soccer league sanctioned by the United States Soccer Federation, which represents the sport\'s highest level in the United States and Canada. The league comprises 27 teams – 24 in the U.S. and 3 in Canada – and will expand to 30 teams by the 2023 season.', NULL, 'AdetonaSolomon', 'mls', '16-04-2021'),
(31, 423, 'Scottish Premiership', 'files/scottish-premiership.png\r\n', 'football', 'The Scottish Premiership is the top division of the Scottish Professional Football League, the league competition for men\'s professional football clubs in Scotland. The Scottish Premiership was established in July 2013, after the SPFL was formed by a merger of the Scottish Premier League and Scottish Football League.', NULL, 'AdetonaSolomon', 'scottish-premiership', '16-04-2021'),
